import React from 'react';
import ReactDOM from 'react-dom';

import NavSide from './components/NavSide';
import Main from './components/Main';

import './index.css'

function App() {
  return (
    <div>
    <NavSide />
    <Main />
    </div>
  );
}

ReactDOM.render(
    <App/>,
    document.getElementById('App')
)
